import React from "react";

function PostedImage() {
    let image = 'http://www.bhc.co.kr/upload/bhc/menu/ck20150130_470_v.jpg'

    return(
        <div style={{
            width: '500px',
            height: '500px',
            margin: 'auto'
        }}>
            <img style={{
            width: '500px',
            margin: 'auto'
        }} alt="chicken" src={image}></img></div>
    )
}

export default PostedImage
